import React from 'react'
import Typist from 'react-typist'
import './App.css';

const NameBox = () => {
  return (
    <div className="LandingPage-NameBox">
      <p className="LandingPage-Name" style={{ color: '#fffff0'}}>Kyle Gloria</p>
      <p className="LandingPage-Name">Kyle Gloria</p>
      <p className="LandingPage-Name" style={{ color: '#ffffe0' }}>Kyle Gloria</p>
    </div>     
  )
}

const App = () => {

  const links = [
    {
      label: 'LinkedIn',
      url: 'https://www.linkedin.com/in/kyle-gloria/',
      image: 'https://www.iconninja.com/files/479/390/409/linkedin-icon.png',
      id: '1'
    },
    {
      label: 'GitHub',
      url: 'https://github.com/KGloria',
      image: 'https://www.iconninja.com/files/930/277/269/github-icon.png',
      id: '2'
    }
  ] 

  return (
    <>
      {/* Icon Overlay */}
      <div className='Icon-Overlay'>
          <div className='Icon-Overlay' style={{     
            right: '-5%',
            top: '40%',
            background: 'none' }}>
          {links.map(link => 
              <a href={link.url} key={link.id}>
                <img src={link.image} alt={link.label} style={{ width: `clamp(14px, 1vw, 24px)` }}/>
                <br/>
              </a>
          )}
        </div>
      </div>

      <div className="App">

        <header className="App-header"> 
            <NameBox/>
            <p className='LandingPage-Desc'>Full Stack Developer | IT Professional</p>

          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn More
          </a>
        </header>
      </div>
    </>
  );
}

export default App;
